script: |
  super -f text -I q5451.spq | sort > q5451.out

inputs:
  - name: q5451.spq
    data: |
      SELECT ALL col2 AS col0 FROM tab1 (FORMAT parquet) WHERE NOT + 23 BETWEEN col1 AND ( + col1 * - ( + 93 ) - + + col0 );
  - name: tab1

outputs:
  - name: q5451.out
    data: |
      59
      68
      96
